import styles from  './Card.module.css';

function Card({front, back}) {

  return (
    <div className={styles.Card}>
      <div class="card">
        <div class={styles.face}>
          {front}
        </div>
        <div class={`${styles.face} back`}>
          {back}
        </div>
      </div>
    </div>
  );
}

export default Card;
